import posts from './../../data/posts';

export default function Tag() {

	let newArr = posts.map((val, idx) => val.tag.split(','))

	const removeDuplicate = () => {
		let duplicates = newArr.reduce((acc, el, i, arr) => {
			if(arr.indexOf(el) !== i && acc.indexOf(el) < 0) {
				acc.push(el);
			}
			return acc;
		},[])
		return duplicates;
	}

	let tags = removeDuplicate(newArr)
	console.log(tags)

	return (
		<>
	    <h3 className="sidebar-title">Tags</h3>
	    <div className="sidebar-item tags">
	      <ul>
	      {/*
	      	tagg.map((tag, idx) => (<li><Link>{tag}</Link></li>))
	      */}
	      </ul>
	    </div>
		</>
	)
}

